const eng=	[ 'q', 'w', 'e', 'r', 't', 'y', 'u', 'i', 'o', 'p', 'a', 's', 'd', 'f', 'g', 'h', 'j', 'k', 'l', 'z', 'x', 'c', 'v', 'b', 'n', 'm'];
function rand(min,max) {
    return Math.Round(Math.random() * (max - min) + min)
}

class NameText extends Component {
    state = { name:"Allax", surname:"Buddovich" };
    render() { 
        return (
            <span className="name">
                {eng[rand(0,eng.length-1)]}:\&gt; {this.state.name} {this.state.surname}
                <span className="textCursor">_</span>
            </span>
        );
    }
}
 
export default NameText;
